version = "1.19.2"
description = "The AWS SDK for Python"
category = "main"
optional = false
python-versions = ">= 3.6"

[package.dependencies]
botocore = ">=1.22.2,<1.23.0"
jmespath = ">=0.7.1,<1.0.0"
